import React from "react";
const Input = ({ handleChange, value, placeholder }) => {
  return (
    <>
    <input
      onChange={(e) => handleChange(e.target.value)}
      defaultValue={value}
      placeholder={placeholder}
      className="input"
    />

    </>

  );
};

export default Input;
